import React from 'react';
import './App.css';

function About() {
  return (
    <div class = 'texto_about'>
        <h1>About Page </h1>
        <p1> Service Status Services publica informações mais atualizadas sobre a disponibilidade dos serviço na tabela abaixo. Volte aqui a qualquer momento para obter informações sobre o status atual ou subscreva o serviço desejado para ser notificado sobre interrupções em cada serviço individual. </p1>
    


    </div>


  );
}

export default About;
